import React from "react";

const Login = () => {

    return (
        <>
            <h1 className="m-4">Login To Your Account</h1>
            <form className="m-4 w-25">

                <label>Email</label>
                <input
                    onChange={changeEmail}
                    type="text"
                    className="form-control mb-3"
                    placeholder="Enter your email"
                />
                <label>Password</label>
                <input
                    onChange={changePassword}
                    type="password"
                    className="form-control mb-3"
                    placeholder="Enter your password"
                />
                <button onClick={handleSubmit} className="btn btn-danger w-100">Create an Account</button>
                <a href="" className="text-black text-decoration-none">Already have an account? Login</a>
            </form>
        </>
    );
};

export default Login;
